O Timaço do Flamengo vai Começar a se Desmontar (Porque a Maioria dos Jogadores já deve estar querendo Encerrar a Carreira Ganhando Bem e Vivendo em algum País que Não seja o Brasil);
Os Mais Jovens, vão Sair pra Jogar em Qualquer Clube Bosta da Europa. Podem ver: Gerson, Paquetá, Pablo Marí, Reinier. O que Mais se deu Bem foi o Vinícius Jr. (depois de 3 ou 4 Anos que Ele Saiu.).
E depois vão Forçar a Saída do Tite para o Renato assumir a Seleção porque Ninguém Mais aguenta essas Convocações Absurdas do Tite. Ganha Tudo nas Eliminatórias e nos Amistosos, e chega na Hora da Copa, Passa Vergonha.
E a partir de 2022, o Corinthians Volta a Retomada de Títulos e Conquistas.

